import React from 'react';

const History = ({ items, onSelect }) => {
  return (
    <div className="history">
      <h2>Conversation History</h2>
      <ul>
        {items.map((item, index) => (
          <li key={index} onClick={() => onSelect(index)}>
            {item.question}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default History;
